INSERT INTO `pill` VALUES (1,'(해외)트리플 스트렝스 오메가3 피쉬오일 (오메가3 1040mg)','',1,1,1,'https://cloudinary.images-iherb.com/image/upload/f_auto,q_auto:eco/images/sre/sre09152/v/24.jpg','스포츠리서치','- 수술 전후 지형을 늦출 수 있음\n- 아스피린과 유사한 영향을 미칠 수 있으므로 아스피린에 민감한 경우 주의','- 기억력 개선, 눈 피로감 개선, 혈액순환 개선','- TG(오메가3 지방산), EPA/TG(에이코사펜타에산), DHA/TG(도코사헥사엔산), 오메가3 지방산','- 건조한 곳에 보관 하십시오. 제품을 과도한 빛, 열 또는 습기에 노출시키지 마십시오.','1일 1회 식후, 물과 함께 복용','CAPSULE','2024-01-31 00:00:00.000000',NULL),(2,'(해외) 멀레큐럴리 디스틸드 오메가3',' ',1,2,2,'https://cloudinary.images-iherb.com/image/upload/f_auto,q_auto:eco/images/now/now01650/v/16.jpg','나우푸드','- 수술 전후 지혈을 늦출 수 있음\n- 아스피린과 유사한 영향을 미칠 수 있으므로 아스피린에 민감한 경우 주의\n','- 눈 건강, 혈액순환 개선, 혈중 중성지방 개선','- 포화 지방, 고도불포화 지방, 단일불포화 지방, 피쉬 오일 농축액, 오메가-3 지방산, EPA(에이코사펜타엔산), DHA(도코사헥사엔산)','- 서늘하고 건조한 곳에 보관하세요','1일 2회 1회당 2정씩 식후, 물과 함께 복용','CAPSULE','2024-01-31 00:00:00.000000',NULL),(3,'프로메가 알티지 오메가3 듀얼','24개월',1,1,2,'https://trueformula.co.kr/web/product/big/202202/0ef01e26c21e7848b95a55e69d29debc.gif','종근당건강(주)','- 섭취량 및 섭취방법을 확인하시고 섭취하여 주십시오. \r\n- 소비기한이 경과된 제품은 섭취하지 않도록 주의 바랍니다. - 제품 개봉 또는 섭취 시 포장재에 의해 상처를 입을 수 있으니 주의하시기 바랍니다. - 특정 성분에 알레르기 체질이신 분은 성분을 확인 후 섭취하여 주십시오. - 임산부, 수유부, 만성질환이 있거나 현재 질병치료중이신 분은 전문의와 상의 후 섭취하십시오. - 의약품(항응고제, 항혈소판제, 혈압강하제 등)복용 시 전문가와 상담하십시오. - 개인에 따라 피부 관련 이상반응이 발생할 수 있습니다. - 이상사례 발생 시 섭취를 중단하고 전문가와 상담하십시오.','- [EPA 및 DHA 함유 유지] 혈중 중성지질 개선·혈행 개선·건조한 눈을 개선하여 눈 건강에 도움을 줄 수 있음 - [비타민E] 항산화 작용을 하여 유해산소로부터 세포를 보호하는데 필요','- 성상 : 고유의 향미가 있고 이미, 이취가 없는 연한 노란색 내용물을 함유한 투명한 타원형 장용성 연질캡슐 - EPA와 DHA의 합 : 표시량(600 mg/1.04g)의 80%~120% - 비타민E : 표시량(11 mg α-TE/1.04g)의 80%~150% - 납(mg/kg) : 3.0 이하 \r\n- 카드뮴(mg/kg) : 1.0 이하 - 수은(mg/kg) : 0.5 이하 - 대장균군 : 음성 - 붕해 : 1액 120분 이상, 2액 60분 이내','서늘하고 건조한 곳에 보관하세요','1일 1회, 1회 2캡슐(1.04 g) 식전, 식후 관계 없이 충분한 물과 함께 섭취하십시오.','CAPSULE','2024-01-31 00:00:00.000000',NULL),(4,'초임계 알티지 오메가3','24개월',1,1,1,'https://imgproxy.pillyze.io/l_Hd8EA2CvShmh864W6SRmsny-A27n2WufaIaEfaNIU/rs:fill:500:500/czM6Ly9waWxseXplLXByZC1pbWFnZS9wcm9kdWN0cy92MS8xay8xODNjMWRiZC0xMzc0LzEwMDA','닥터린','- 특정질환, 특이체질, 알레르기 체질, 임산부의 경우에는 간혹 개인에 따라 과민반응이 나타날 수 있으므로 원료를 확인하시고, 섭취전에 전문가와 상담하시기 바랍니다. - 의약품(항응고제, 항혈소판제, 혈압강하제 등) 복용 시 전문가와 상담할 것 - 개인에 따라 피부 관련 이상반응이 발생할 수 있음 - 이상사례 발생 시 섭취를 중단하고 전문가와 상담할 것 - 고칼슘혈증이 있거나 의약품 복용 시 전문가와 상담할 것 - 이상사례 발생 시 섭취를 중단하고 전문가와 상담할 것','- [EPA 및 DHA 함유 유지] 혈중 중성지질 개선·혈행 개선·건조한 눈을 개선하여 눈 건강에 도움을 줄 수 있음 - [비타민D] 칼슘과 인이 흡수되고 이용되는데 필요/ 뼈의 형성과 유지에 필요/ 골다공증발생 위험 감소에 도움을 줌 - [비타민E] 항산화 작용을 하여 유해산소로부터 세포를 보호하는데 필요\r\n','- 성상 : 고유의 향미가 있고 이미·이취가 없는 노란하얀색의 점도가 있는 내용물을 함유한 투명의 장방형 연질캡슐 - EPA와 DHA의 합 : 표시량(600mg/1025mg)의 80~120% - 비타민D : 표시량(10μg/1025mg)의 80~180% - 비타민E : 표시량(11mg α-TE/1025mg)의 80~150% - 납(mg/kg) : 3.0 이하 - 카드뮴(mg/kg) : 1.0 이하 - 수은(mg/kg) : 0.5 이하 - 대장균군 : 음성 - 붕해 : 20분이내','- 고온다습한 곳과 직사광선을 피하여 습기가 적고 건조한 곳에 보관하십시오 - 개봉 후에는 공기의 노출을 최대한 차단하여 보관하십시오 - 영유아 및 어린이의 손에 닾지 않는 곳에 보관하십시오 - 온도 및 습도 등의 변화에 캡슐이 붙는 현상이 발생 될 수 있으나 품질에 이상이 없으니 안심하고 섭취하시오\r\n\r\n','1일 1회, 1회 1캡슐을 물과 함께 섭취하십시오. ','CAPSULE','2024-01-31 00:00:00.000000',NULL),(5,'GNM 건강한 간 밀크씨슬','24개월',1,1,1,'https://m.gnmlife.com/web/product/big/202308/3535153e37749b2835dd0790c19f34e0.jpg','주식회사한미양행','- 어린이, 임산부 및 수유부는 섭취를 피할 것 - 알레르기 반응이 나타나는 경우에는 섭취 중단 - 설사, 위통, 복부팽만 등의 위장관계 장애가 나타나는 경우에는 섭취에 주의 - 이상사례 발생 시 섭취를 중단하고 전문가와 상담할 것 알레르기 체질이신 경우 성분을 확인 한 후 섭취하시기 바랍니다.','- 간 건강에 도움을 줄 수 있음 - 탄수화물과 에너지 대사에 필요 - 체내 에너지 생성에 필요 - 지방, 탄수화물, 단백질 대사와 에너지 생성에 필요 - 단백질 및 아미노산 이용에 필요 - 혈액의 호모시스테인 수준을 정상으로 유지하는데 필요','- 성상 : 고유의 향미를 지니고 이미, 이취가 없는 연한 황갈색 또는 흐린 노란색의 장방형 제피정제. - 실리마린 : 표시량(130 mg/900 mg)의 80% 이상 120% 이하 - 비타민 B1 : 표시량(1.1 mg/900 mg)의 80% 이상 180% 이하 - 비타민 B2 : 표시량(1.2 mg/900 mg)의 80% 이상 180% 이하 - 나이아신 : 표시량(13.5 mgNE/900 mg)의 80% 이상 150% 이하 - 판토텐산 : 표시량(4.6 mg/900 mg)의 80% 이상 180% 이하 - 비타민B6 : 표시량(1.4 mg/900 mg)의 80% 이상 150% 이하 - 납(mg/kg) : 1.0 이하 - 카드뮴(mg/kg) : 0.5 이하 - 비소(mg/kg) : 1.0 이하 - 수은(mg/kg) : 0.5 이하 - 대장균군 : 음성 \r\n- 붕해시험 : 60분 이내','','1일 1회, 1회 1정을 충분한 물과 함께 섭취','TABLET','2024-01-31 00:00:00.000000',NULL),(6,'아이클리어 루테인지아잔틴','24개월',1,1,1,'https://img